import React from "react";

function Parallax() {
  const parallaxStyle = {
    display: "flex",
    flexDirection: "column",
    backgroundImage: "url('/online-shop.jpg')",
    width: "100%",
    height: "700px",
    backgroundAttachment: "fixed",
    backgroundSize: "100% 100%",
    alignItems: "center",
    justifyContent: "center",
  };

  return (
    <div style={parallaxStyle}>
    </div>
  );
}

export default Parallax;
